import logo from './logo.svg';
import './App.css';

function App() {
  function unique(arr) {
    return new Array(new Set(arr))
  }

  let values = ["Hare", "Krishna", "Hare", "Krishna",
    "Krishna", "Krishna", "Hare", "Hare", ":-O"
  ];

  alert(unique(values)); // Hare,Krishna,:-O
  return (
    <div className="App">

    </div>
  );
}

export default App;
